INSERT INTO `drupal_webform_submitted_data` VALUES (1718,5,6,0,'07.2009 – 09.2009 Unilever Polska\r\nStanowisko: Praktykant w Dziale Finansów; kierowanie projektem analizy branżowej, modelowanie finansowe, analizy kosztów i strategicznych przewag konkurencyjnych\r\n07.2008 Beskidzki Dom Maklerski - praktyka wygrana w konkursie inwestycyjnym NewTrader\r\nStanowisko: Praktykant; bieżące analizy i komentarze giełdowe, nauka systemów zarządzania kapitałem, metod analizy i funkcjonowania rynku kapitałowego\r\n07.2007 – 02.2008 Amplico AIG Life\r\nStanowisko: Doradca ubezpieczeniowy; obsługa klientów indywidualnych w zakresie ubezpieczeń i finansów, budowanie relacji z klientami, indywidualne planowanie finansowe\r\n06.2006 – 06.2007 Sklep internetowy AT F.H.U.\r\nStanowisko: Sprzedawca; zarządzanie zawartością sklepu internetowego, kontakt z klientami i realizacja zamówień');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,5,7,0,'Działalność w Stowarzyszeniu Przyszłych Doradców i Menedżerów Cognitis (dawniej SKND) od 2006 do 2010\r\n2009 - Ambasador firmy Deloitte na Uniwersytecie Ekonomicznym w Poznaniu\r\nOrganizowanie i promocja szkoleń oraz konkursów firmy Deloitte na UE w Poznaniu.\r\n2008 - Koordynator projektu „Dzień z IT” na Politechnice Poznańskiej\r\nPlan, zarządzanie pracą zespołu i działanie w zakresie kontaktowania zewnętrznego, organizacji, finansów, PR i promocji wydarzenia, w którym uczestniczyło 6 firm.\r\n2008 - Koordynator wyjazdu szkoleniowego Stowarzyszenia\r\nPlanowanie, kontaktowanie, księgowanie i zarządzanie zespołem projektowym.\r\n2008 - Przeprowadzenie szkolenia z zarządzania projektami dla Stowarzyszenia');
