INSERT INTO `drupal_webform_submitted_data` VALUES (1718,15,6,0,'W okresie 16.06 - 04.07.2008 byłem praktykantem w dziale finansowym w firmie Oerlikon Balzers sp. z o.o. z siedzibą w Polkowicach. Dzięki temu doświadczeniu zobaczyłem, jak wygląda praca działu finansowego, a także rachunkowości oraz sprzedaży w średniej firmie. Moimi zadaniami była doraźna pomoc pracownikom, którzy dokładali wszelkich starań i poświęcali czas, aby tłumaczyć mi szczegóły ich zadań. Dzięki temu praktykę uważam za udaną. \r\n');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,15,7,0,'Przez rok byłem członkiem Zarządu oraz Sekretarzem Europejskiego Forum Studentów AEGEE-Poznań (kadencja 2009).\r\nhttp://www.aegee.nets.pl/index.php?option=com_content&view=article&id=74&Itemid=63〈=pl\r\nTen okres dał mi najwięcej, nasza organizacja była bardzo aktywna (zwiększenie liczby członków z 78 do 107), organizując w 2009 trzy event\'y dla studentów z całej Europy (YVote, Summer University oraz Network Meeting), a także wiele na poziomie lokalnym, w tym 2 razy Local Training Course (w roli trenera), Dzień Europy 2009, Dzień Studenta 2009, VIP Szkoła Trenerów. W okresie V-XI.2008r. pracowaliśmy jako AEGEE-Poznań nad projektem Dzień Studenta 2008. Zajmowałem funkcję Koordynatora ds. Fund Raising. Odbyłem w tym czasie dziesiątki rozmów z firmami oraz prorektorami poznańskich uczelni. Działania mojego zespołu zakończyły się dużym sukcesem, w ich wyniku pozyskany budżet przekroczył 30 tys. zł. Ponadto brałem udział jako reprezentant AEGEE-Poznań w spotkaniu statutowym AEGEE, z ponad 700 studentami z całej Europy, Aachen (Niemcy), 01-04.09.2008\r\n');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,15,9,0,'-');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,15,10,0,'Moje główne zainteresowania to:\r\nTechnologie informacyjne\r\nFinanse przedsiębiorstw\r\nZarządzanie projektem\r\nPodróże\r\nNauka języków obcych\r\nMnemotechniki i rozwój osobisty\r\n');
