INSERT INTO `drupal_webform_submitted_data` VALUES (1718,15,12,0,'Szkolenia krajowe:\r\n	McKinsey Leadership Seminar, Warszawa, 24-26.04.2009\r\n	World of Audit, KPMG, cykl 4 szkoleń o tematyce audytu, Poznań, 04-05.2009\r\n\r\nSzkolenia międzynarodowe:\r\n	Danube – the most international river, szkolenie o tematyce rozwoju ekologicznego Europy, Bratysława, 7-13.09.2009\r\n	Let’s Play Together, 5-stronna wymiana studencka o tematyce integracji poprzez sport, Madryt, 9-17.05.2009\r\n	YOUrope needs YOU - szkolenie z zakresu edukacji europejskiej uczniów szkół średnich, Oviedo (Hiszpania), 9-14.03.2009\r\n	STEP ONE, Międzynarodowe szkolenie na temat edukacji nieformalnej i zarządzania projektem - Kusadasi (Turcja), 01-09.11.2008  \r\n	Europejskie spotkanie statutowe AEGEE, Aachen (Niemcy), 01-04.09.2008\r\n	Tandemowy kurs języka niemieckiego, Domaniewice/Oberau, 3-31.08.2008\r\n	Intercultural Dialogue, międzynarodowy trening o tematyce zarządzania projektami międzynarodowymi dla aktywnej młodzieży z Europy i Azji, 26.04 - 04.05.2008\r\n	European School I, międzynarodowe szkolenie z umiejętności potrzebnych do zarządzania projektem  i pracy w zespole, Enschede (Holandia), 08-16.03.2008\r\n\r\nOsiągnięcia:\r\n	Członek „PwC Business Case Project”, ogólnopolskiego projektu biznesowego będącego symulacją pracy konsultantów zajmujących się doradztwem dla dużych firm i instytucji zorganizowanego przez firmę PricewaterhouseCoopers, 04-05.2010\r\n	I miejsce w Case Study \"Sprawozdawczość MSSF spółki Tanie Tankowanie S. A. w czasach kryzysu\" zorganizowanym przez firmę Ernst&Young, Poznań, 31.03.2010\r\n	I miejsce w polskiej edycji konkursu Deloitte International Student Business Forum 2010 o tematyce rachunkowości i audytu, październik-grudzień 2009\r\n	I miejsce w Międzynarodowym Konkursie Wiedzy Biznesowej EBC*L Champions League 2008, Wiedeń, 28.11.2008\r\n	I miejsce w Konkursie na Najlepszego Ekonomistę Poznania wśród studentów INGRESO 2009 organizowanym przez WSB i PricewaterhouseCoopers, \r\n28-29.04.2009\r\n	II miejsce w Konkursie na Najlepszego Ekonomistę Poznania wśród studentów INGRESO 2008 organizowanym przez WSB i HLB Frąckowiak, 3.04.2008\r\n	I miejsce w ogólnopolskim konkursie Złap Konsulting w dziedzinie doradztwa podatkowego, organizowanym przez PricewaterhouseCoopers, 30.11.2007\r\n	Zakwalifikowanie się do finału Programu transferu innowacji do biznesu Innowatorzy 2007 z projektem „Ingenium – Internetowe Ścieżki Kariery”\r\n	Laureat konkursu „Złota Mysz 2007”  na najlepszy projekt e-biznesowy organizowanego przez Katedrę Technologii Informacyjnych Akademii Ekonomicznej w Poznaniu\r\n\r\n\r\nMcKinsey Club - członkostwo w  klubie założonym przez McKinsey & Company, udział w spotkaniach z konsultantami, dyskusje biznesowe, zamknięte szkolenia i inne (od 02.2009)\r\n\r\nUdział w Local Training Course Wiosna 2009 oraz Local Training Course Jesień 2009 jako trener i członek Zarządu. Podczas pierwszego z tych szkoleń przeprowadziłem szkolenie z Fund Raisingu dla 28 osób, natomiast podczas drugiego szkolenie Office Survival dla 26 osób. Ponadto na obu event\'ach byłem mentorem 6-osobowej grupy projektowej. \r\n\r\nUdział w dwóch uniwersytetach letnich, których celem była nauka języka greckiego oraz włoskiego:\r\n\r\nSummer University 2008, Patra (Grecja), \"Master your greeklish!\", 16-30.08.2008\r\n\r\nSummer University 2009, Messina (Włochy), \"Let\'s go straight to the Strait!\", 17-31.08.2009\r\n\r\n\r\n');
