INSERT INTO `drupal_webform_submitted_data` VALUES (1718,22,6,0,'11.2009 – 02.2010 staż w Morison Finansista Corporate Finance \r\nuczestnictwo w opracowywaniu analiz finansowych, wycen przedsiębiorstw i koncepcji restrukturyzacji przedsiębiorstw, weryfikacja inwestycji planowanych przez potencjalnych klientów pod kątem możliwości pozyskania dofinansowania z funduszy unijnych;\r\n\r\n09.2009 – 09.2009 praktyka w Centrum Likwidacji Szkód i Oceny Ryzyka w TU Allianz\r\nobsługa klienta, rejestracja szkód w systemie informatycznym, administracja korespondencją przychodzącą, archiwizacja dokumentów, wsparcie w czynnościach administracyjno biurowych; \r\n\r\n08.2009 – 08.2009 praktyka w Billa Polska spółka z o.o.\r\nprace administracyjne i pomocnicze w Biurze Zarządu;\r\n\r\n07.2009 – 08.2009 praktyka w Dziale Księgowości w Eurocash S.A.\r\nwstępna weryfikacja poprawności wystawionych dokumentów przez dostawców, księgowanie dokumentów w systemie, przygotowanie dokumentów do archiwizacji;\r\n\r\n06.2008 – 07.2008 praktyka w Medana Pharma S.A\r\n');
