INSERT INTO `drupal_webform_submitted_data` VALUES (1718,22,12,0,'Informacje dodatkowe\r\nuczestnictwo w projekcie Zarządzanie Ryzykiem w przedsiębiorstwie rolnym\r\n\r\nuczestnictwo w projekcie Zalety i wady prowadzenia działalności ubezpieczeniowej w zakresie ubezpieczenia kredytów w formie oddziału zagranicznego zakładu ubezpieczeń i krajowego zakładu ubezpieczeń. \r\n\r\nuczestnictwo w Konferencji Naukowej Rynek ubezpieczeń w dobie kryzysu gospodarczego jako współautor artykułu Wpływ kryzysu finansowego na sytuację Swiss Re – jednego z głównych reasekuratorów polskich zakładów ubezpieczeń.\r\n\r\n\r\nKursy / szkolenia / warsztaty\r\n\r\nSprawozdawczość MSSF spółki Tanie Tankowanie S.A. w czasach kryzysu (warsztat prowadzony przez Ernst & Young; zajęcie II miejsca w case przeprowadzonym podczas warsztatu)\r\n\r\nPierwsze wrogie przejęcia na polskim rynku (warsztat  prowadzony  przez PBDA  organizowany w ramach festiwalu przedsiębiorczości BOSS)\r\n\r\nDoradztwo transakcyjne – fuzje i przejęcia w praktyce (szkolenie zorganizowane przez KZWS w ramach Dni Kariery)\r\n\r\nInnowacyjne Fundusze Europejskie na Innowacyjne Inwestycje (konferencja prowadzona przez Deloitte organizowana przez Konfederację Pracodawców Polskich)\r\n\r\n');
