INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,6,0,'luty 2009 - obecnie:   Imperial Tobacco Polska S.A., stanowisko: asystent w Dziale Controllingu, \r\n                                obowiązki: analiza przyczynowo-skutkowa odchyleń, analizy Working Capital, \r\n                                operowanie MFG/Pro, SAP, MS Office.\r\nczerwiec 2008 - sierpień 2008:   Stanley (hurtownia materiałów budowlanych), stanowisko: asystent w Dziale   \r\n                                               Finansowym, \r\n                                               obowiązki: analizy progu rentowności oraz bezpośredni kontakt z klientami   \r\n                                               kluczowymi');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,7,0,'Studenckie Forum Business Centre Club\r\n- koordynator Festiwalu Przedsiębiorczości BOSS\r\n\r\nParlament Studencki Uniwersytetu Ekonomicznego w Poznaniu\r\n- przedstawiciel studentów w Radzie Wydziału Ekonomii UEP;\r\n- przedstawiciel studentów w Komisji Programowej UEP;\r\n- koordynator konferencji \'Erasmus - nowe miejsca, nowe możliwości\';\r\n- członkini Komisji ds. Kontaktów Zewnętrznych;\r\n- członkini Komisji ds. Kultury i Sportu.');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,9,0,'Język angielski: Certyfikat BEC Higher (poziom C1, język biznesowy)\r\nJęzyk rosyjski: Certyfikat Instytutu Puszkina (poziom B2, język biznesowy, zdany z wyróżnieniem)');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,10,0,'Moim hobby. które pochłania w zasadzie cały wolny czas jest dobra literatura skłaniająca do przemyśleń. W szcególności  Dostojewski, Tołstoj, Gogol w oryginale. Ponadto dla odprężenia po długim tygodniu pracy Jane Austin opowiadająca o egzystencji XIX wiecznej angielskiej klasy wyższej, a to wszystko w niespotykanym już starodawnym języku ojczystym autorki.\r\nZ rozrywek na świeżym powietrzu uwielbiam spływy kajakowe i mecze koszykówki.\r\nZa fantastyczną rozrywkę uważam też krytyczne dyskusje nad dziełami wielkich ekonomistów albo niekończące się dialogi na temat polityki, toczone z moimi rówieśnikami i rodzicami.');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,11,0,'obowiązkowość, często przesadna skrupulatność, potrzeba stawiania sobie coraz to nowych wyzwań');
INSERT INTO `drupal_webform_submitted_data` VALUES (1718,24,12,0,'W marcu 2010 roku wraz z moją drużyną zajęliśmy II miejsce w ogólnopolskim konkursie Progress Accounting Competition (konkurs obejmował tematykę rachunkowości i sprawozdawczości międzynarodowej).\r\n\r\nJuż trzeci semestr jestem stypendystką Imperial Tobacco Polska S.A. w ramach programu Imperium Twoich Możliwości. Jednym z warunków otrzymania stypendium są wyróżniające się osiągnięcia naukowe.\r\n\r\nDwa razy brałam udział w programie Work&Travel w USA. \r\n\r\nByłam uczestnikiem:\r\nAkademii Rachunkowości Deloitte,\r\nAkademii Podatkowej Deloitte,\r\na także wielu innych szkoleń oraz case study z zakresu finansów, rachunkowości, sprawozdawczości finansowej i controllingu.\r\n');
