INSERT INTO `drupal_webform_submitted_data` VALUES (1718,26,12,0,'Finalistka VII Ogólnopolskiego Studenckiego Konkursu Amatorów Rachunkowości Uczelniada 2009\r\n\r\nPublikacje naukowe:\r\n1. Znaczenie finansowej analizy due diligence w wyborze przedmiotów inwestowania w czasach kryzysu finansowego, w: Rachunkowość wobec wyzwań współczesnej gospodarki, red. Sojak S., Kozak P., Wydawnictwo Naukowe Uniwersytetu Mikołaja Kopernika, Toruń 2010\r\n2. Istota kontynuacji działalności jednostki gospodarczej w świetle aktualnego kryzysu finansowego, w: Rachunkowość i audyt w warunkach kryzysu finansowego, Materiały konferencyjne, KiBR, Poznań 2009\r\n3. Środki trwałe w świetle regulacji podatkowych i bilansowych w małych jednostkach gospodarczych, w: Rachunkowość i audyt w warunkach kryzysu finansowego, Materiały konferencyjne, KiBR, Poznań 2009\r\n\r\nKursy i szkolenia:\r\n - Kurs języka angielskiego Upper – Intermediate, Szkoła Profi – Lingua, Poznań\r\n - Szkolenie: „Prawo podatkowe w działalności gospodarczej”, Festiwal Przedsiębiorczości BOSS 2010, Poznań\r\n - Warsztat: „Dbanie o informację zwrotną i ciągłe uczenie się”, KPMG Sp. z o. o., Poznań\r\n - Warsztat: „Zaangażowanie i elastyczność w działaniu”, \r\nKPMG Sp. z o. o., Poznań\r\n - Szkolenie: „Fundusze unijne – szansą rozwoju zawodowego”, Akademia Umiejętności Dni Kariery 2009, AIESEC Poznań\r\n\r\n\r\n');
