INSERT INTO `drupal_webform_submitted_data` VALUES (1718,36,6,0,'VIII.2008-obecnie - praca jako analityk finansowy w Kancelarii Doradztwa Kredytowego i Nieruchomości AQUARIUS INVEST, Poznań. Zakres obowiązków:\r\n- Przygotowanie biznesplanów dla przedsięwzięć inwestycyjnych finansowanych  \r\n  kredytem (branża drzewna, produkcja wyrobów metalowych, nieruchomości \r\n  mieszkalne i komercyjne) oraz z funduszy Unii Europejskiej (system \r\n  informatyczny CRM);\r\n- Kompletowanie dokumentacji kredytowej klientów, przygotowanie uzasadnień \r\n  (m.in. przedsiębiorstwo transportowe);\r\n- Inspekcja nieruchomości stanowiących zabezpieczenie hipoteczne;\r\n- Tworzenie prospektu oraz planu strategicznego opisującego działalność firmy \r\n  (branża pośrednictwa kredytowego i nieruchomości). \r\n\r\n\r\nVII.2008 - praca jako asystent w ramach praktyk studenckich w firmie Financial One Sp. z o.o., Poznań. Zakres obowiązków: \r\n- Korekta, analiza i uzupełnianie dokumentacji kredytowych klientów, \r\n- Poszukiwanie możliwości sfinansowania projektów inwestycyjnych z funduszy    \r\n  Unii Europejskiej, \r\n- Budowa internetowej bazy danych nieruchomości.\r\n');
